css:
@-webkit-keyframes flash {
  0% {
    background-color: #faf4cb;
    opacity: 1;
    font-weight: bold;
    -webkit-transform: scale(1.5, 1.5);
  }
  100% {
    background-color: #e1d378;
    opacity: 0.7;
  }
}
.demo {
  -webkit-animation-name: demo;
  -webkit-animation-duration: 900ms;
  -webkit-animation-iteration-count: 1;
  -webkit-animation-timing-function: ease-in-out;
}
.editor-colors {
  background-color: #ffffff;
  color: #000000;
}
.editor {
  background-color: #ffffff;
  color: #000000;
}
.editor .wrap-guide {
  background-color: #ededed;
}
.editor .indent-guide {
  color: #cccccc;
}
.editor .invisible-character {
  color: #929292;
}
.editor .gutter {
  background-color: #f7f7f7;
  color: #929292;
}
.editor .gutter .line-number {
  color: #929292;
}
.editor .gutter .line-number.cursor-line-no-selection,
.editor .gutter .line-number.cursor-line {
  color: #9a92a3;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: #e6e6e6;
}
.editor .invisible {
  color: #000000;
}
.editor .cursor {
  color: #000000;
}
.editor .selection .region {
  background-color: #e8f2fe;
}
.editor.is-focused .cursor {
  border-color: #000000;
}
.editor.is-focused .selection .region {
  background-color: #e8f2fe;
}
.editor.is-focused .line-number.cursor-line-no-selection {
  background-color: #f7f7f7;
}
.editor.is-focused .line.cursor-line {
  background-color: #e8f2fe;
}
.active .editor.is-focused .line.cursor-line {
  border-top: 1px solid #b6d6fd;
  border-bottom: 1px solid #b6d6fd;
  margin: -1px 0;
}
.editor.mini .scroll-view {
  padding-left: 1px;
}
.editor .search-results .marker .region {
  background-color: #faf4cb;
  border: 1px solid #e1d378;
  margin: -1px 0;
}
.editor .search-results .marker.current-result .region {
  background-color: #e1d378;
  border: 1px solid #faf4cb;
  margin: -1px 0;
}
.comment {
  color: #008312;
}
.entity.name.type {
  color: #508187;
}
.entity.other.inherited-class {
  color: #6f41a7;
}
.keyword {
  color: #b833a1;
}
.keyword.control {
  color: #b833a1;
}
.keyword.operator {
  color: #000000;
}
.keyword.other.special-method {
  color: #3d237f;
}
.keyword.other.unit {
  color: #b833a1;
}
.storage {
  color: #508187;
}
.constant {
  color: #33595d;
}
.constant.character.escape {
  color: #cf3125;
}
.constant.numeric {
  color: #2934d4;
}
.constant.other.color {
  color: #2934d4;
}
.constant.other.symbol {
  color: #33595d;
}
.variable {
  color: #508187;
}
.variable.interpolation {
  color: #3d6267;
}
.variable.parameter.function {
  color: #000000;
}
.invalid.illegal {
  background-color: #cc6666;
  color: #ffffff;
}
.string {
  color: #cf3125;
}
.string.regexp {
  color: #77492d;
}
.string.regexp .source.ruby.embedded {
  color: #77492d;
}
.string.other.link {
  color: #1b42fb;
}
.punctuation.definition.comment {
  color: #008312;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #000000;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #008312;
}
.punctuation.definition.bold {
  color: #008312;
  font-style: bold;
}
.punctuation.definition.italic {
  color: #008312;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #00500b;
}
.support.class {
  color: #f0c674;
}
.support.function {
  color: #8abeb7;
}
.support.function.any-method {
  color: #81a2be;
}
.entity.name.function {
  color: #33595d;
}
.entity.name.class,
.entity.name.type.class {
  color: #508187;
}
.entity.name.section {
  color: #81a2be;
}
.entity.name.tag {
  color: #cc6666;
}
.entity.other.attribute-name {
  color: #957d3a;
}
.entity.other.attribute-name.id {
  color: #33595d;
}
.meta.class {
  color: #f0c674;
}
.meta.link {
  color: #1b42fb;
}
.meta.require {
  color: #81a2be;
}
.meta.selector {
  color: #b294bb;
}
.meta.separator {
  background-color: #373b41;
  color: #000000;
}
.none {
  color: #000000;
}
.markup.bold {
  color: #de935f;
  font-style: bold;
}
.markup.changed {
  color: #b294bb;
}
.markup.deleted {
  color: #cc6666;
}
.markup.italic {
  color: #b294bb;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #81a2be;
}
.markup.inserted {
  color: #b5bd68;
}
.markup.list {
  color: #cc6666;
}
.markup.quote {
  color: #de935f;
}
.markup.raw.inline {
  color: #b5bd68;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #b5bd68;
}
.bracket-matcher {
  background-color: #e1d378;
  border: none;
  -webkit-animation-name: flash;
  -webkit-animation-duration: 500ms;
  -webkit-animation-iteration-count: 1;
  -webkit-animation-timing-function: ease-in-out;
}
